import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import Chip from '@material-ui/core/Chip'

function Child( {name,remove} ) {
  return (
    <Chip
        label={name}
        onDelete={() => remove(name)}
        color='secondary'
    >
    </Chip>

  );
}

export default Child;
